        self.label.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:10pt; font-weight:700;\">Spikeling</span><span style=\" font-size:10pt;\"> is an educational tool for neuroscience students and enthusiasts!</span></p><p><span style=\" font-size:10pt;\">It is an artificial neuron that can receive different inputs, integrate them and send and outputs its computation, just like a spiking neuron would!</span></p><p><span style=\" font-size:10pt;\">Technically, it consists on a microcontroller (an ESP32) running the computationally efficient Izhikevich model of a spiking neuron.</span></p><p><br/></p><p><span style=\" font-size:10pt; color:#268bd2;\">This project is licensed under the </span><span style=\" font-size:10pt; font-weight:700; color:#268bd2;\">GNU General Public License v3.0</span></p><p><span style=\" font-size:10pt; color:#268bd2;\">The hardware is licensed under the </span><span style=\" font-size:10pt; font-weight:700; color:#268bd2;\">CERN OHL v1.2</span></p></body></html>"))
        self.label_10.setText(_translate("MainWindow", "<html><head/><body><p align=\"justify\">Understanding how neurons encode and compute information is fundamental to our study of the brain, but opportunities for hands-on experience with neurophysiological techniques on live neurons are scarce in science education.</p><p align=\"justify\">Originally developped in the Baden Lab at the University of Sussex, Spikeling is an <span style=\" font-style:italic;\">in-silico</span> neuron that mimics a wide range of neuronal behaviours for classroom education and public neuroscience outreach.</p><p align=\"justify\">The current version is the result of a collective work from on-field teaching experience, both in the UK and on the African continent and from users and students feedback.</p><p align=\"justify\">The GUI presented here proposed a full and didactic interaction with the neuronal model. It also contains various exercices which can be linked to classical neuroscience teachings from early to advanced degree students. Futhermore it offers the opportunity to teachers to prepare practical on: programming, data analysis scipting, methodology and protocol design. All very important skills for modern neuroscience academics but which is unfortunately widely lacking from neuroscience degrees education.</p></body></html>"))
